import React from "react";
import { Link } from "react-router-dom";

function HomePage() {
    return (
        <div className="bg-white text-gray-800">
            {/* Navigation Bar */}
            <nav className="bg-blue-600 text-white p-4">
                <div className="container mx-auto flex justify-between items-center">
                    <div className="flex items-center">
                        <span className="font-bold text-xl">AIESEC in Ruhuna</span>
                    </div>
                    <ul className="flex space-x-4">
                        <li><Link className="hover:underline" to="/">Home</Link></li>
                        <li><Link className="hover:underline" to="/login">Login</Link></li>
                    </ul>
                </div>
            </nav>

            {/* Hero Section */}
            <section className="relative h-96 flex items-center justify-center bg-gray-200">
                <h1 className="text-4xl font-bold text-white">Welcome to AIESEC in Ruhuna</h1>
            </section>

            {/* Footer */}
            <footer className="bg-blue-600 text-white py-8 text-center">
                <p>&copy; 2025 AIESEC in Ruhuna. All Rights Reserved.</p>
            </footer>
        </div>
    );
}

export default HomePage;
